import React from "react";
import Block from ".././Block";

export default function Grid({ content, clickHandler }) {
  return (
    <div className="grid">
      {content.map((obj) => {
        return <Block text={obj.text} clickHandler={clickHandler} />;
      })}
    </div>
  );
}
